import React from 'react';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import Button from '@mui/material/Button';

function NavigationButtons({ onPrevClick, onNextClick }) {
    return (
        <Box sx={{ mt: 3, border: '1px solid black' }}>
            <Grid container spacing={8} >
                <Grid item xs={3}>
                    <Button variant="contained" color="primary" type="button" onClick={onPrevClick}>
                        Previous
                    </Button>
                </Grid>
                <Grid item xs={3}>
                    <Button variant="contained" color="primary" type="button" onClick={onNextClick}>
                        Next
                    </Button>
                </Grid>
            </Grid>
        </Box>
    );
}

export default NavigationButtons;
